import React from "react";


export var  Uma=()=>
{
    const food={
        fontColor:'blue'
    }

    return 
    (
       <> <h2 style={{color:'pink'}}>Uma is smart girl</h2>
        <ol style={food}>UMA FAVORIATE FOOD
            <li>Poori</li>
            <li>Dhosa</li>
            <li>Lemon Rice</li>
            <li>Parotta</li>
        </ol>
        </>
    )
}
